import { Grid, Box, Typography } from "@mui/material";
import { Item } from "./Item.js";

const mockEvents = [
  { name: "event1" },
  { name: "event2" },
  { name: "event3" },
  { name: "event4" },
  { name: "event5" },
];

function OfficeTriage() {
  return (
    <Box padding={4}>
      <Grid item xs={4}>
        <Typography>TO DO</Typography>
        <Grid item xs={12}>
          <Item>TEST</Item>
        </Grid>
      </Grid>
      <Grid item xs={3}>
        <Typography>IN PROGRESS</Typography>
        <Grid item xs={12}>
          <Item>TEST</Item>
        </Grid>
      </Grid>
      <Grid item xs={3}>
        <Typography>COMPLETED</Typography>
        <Grid item xs={12}>
          <Item>TEST</Item>
        </Grid>
      </Grid>
    </Box>
  );
}

export default OfficeTriage;
